    function[CD,CL,CY,Cl,Cm,Cn,mSim,Ixx,Iyy,Izz,Ixz,cBar,b,Thrust] ...    	= AlphaModel(x,u,alphar,betar,V)%   VERSION 2%   June 17, 2023%	===============================================================%	Copyright 2023 by ROBERT F. STENGEL.  All rights reserved.	global mSim SMsim Ixx Iyy Izz Ixz b cBar        load('AlphaModelData.mat')% ('AlphaModelData.mat','ACtype','MODEL','mSim','Ixx','Iyy','Izz','Ixz','cBar','b','S',...%       'SMsim','StaticThrust','epsilon','AlphaTable','AlphaLength',...%       'CLTable','CLAlphaTable','CLqHatTable','CLdETable','CLdFTable','CLdSTable',...%       'CDTable','CDAlphaTable','CDqHatTable','CDdETable','CDdFTable','CDdSTable',...%       'CmTable','CmAlphaTable','CmqHatTable','CmdETable','CmdFTable','CmdSTable',...%       'CYBetaTable','CYpHatTable','CYrHatTable','CYdATable','CYdRTable','CYdASTable',...%       'ClBetaTable','ClpHatTable','ClrHatTable','CldATable','CldRTable','CldASTable',...%       'CnBetaTable','CnpHatTable','CnrHatTable','CndATable','CndRTable','CndASTable');    [airDens,airPres,temp,soundSpeed] = Atmos(-x(6));    Thrust      =	u(4)*StaticThrust*(airDens/1.225)^0.7 ...				    *(1 - exp((-x(6) - 17000)/2000));                                           alphadeg    =   alphar*180/pi;	%	Current Longitudinal Characteristics%	====================================%	Lift Coefficient	CLstat  =	interp1(AlphaTable,CLTable,alphadeg);	CLalph  =	interp1(AlphaTable,CLAlphaTable,alphadeg);	CLq	    =	interp1(AlphaTable,CLqHatTable,alphadeg)*cBar/(2*V);    CLdE	=	interp1(AlphaTable,CLdETable,alphadeg);	CLdF	=	interp1(AlphaTable,CLdFTable,alphadeg);    CLdS    =	interp1(AlphaTable,CLdSTable,alphadeg);        CL      =	CLstat + CLq*x(8) + CLdE*u(1) + CLdF*u(6) + CLdS*u(7);%	Drag Coefficient	CDo     =	interp1(AlphaTable,CDTable,alphadeg);	CDq	    =	interp1(AlphaTable,CDqHatTable,alphadeg)*cBar/(2*V);    CDdE	=	interp1(AlphaTable,CDdETable,alphadeg);	CDdF	=	interp1(AlphaTable,CDdFTable,alphadeg);    CDdS	=	interp1(AlphaTable,CDdSTable,alphadeg);    CD      =	CDo + epsilon*CL^2 + CDq*x(8) + CDdE*u(1) + CDdF*u(6) ...                + CDdS*u(7);%   disp(['T = ',num2str(Thrust),' CD = ',num2str(CD),' CDo = ',num2str(CDo)])%	Pitching Moment Coefficient	CmStat  =	interp1(AlphaTable,CmTable,alphadeg);	Cmq     =   interp1(AlphaTable,CmqHatTable,alphadeg)*cBar/(2*V);	CmdE	=	interp1(AlphaTable,CmdETable,alphadeg);	CmdF	=	interp1(AlphaTable,CmdFTable,alphadeg);    CmdS	=	interp1(AlphaTable,CmdSTable,alphadeg);    Cm      =	CmStat - CL*SMsim + Cmq*x(8) + CmdE*u(1)+ CmdF*u(6) + CmdS*u(7);	%	Current Lateral-Directional Characteristics%	===========================================%	Side-Force Coefficient	CYbeta  =	interp1(AlphaTable,CYBetaTable,alphadeg);    CYp     =   interp1(AlphaTable,CYpHatTable,alphadeg)*b/(2*V);    CYr     =   interp1(AlphaTable,CYrHatTable,alphadeg)*b/(2*V);	CYdA    =   interp1(AlphaTable,CYdATable,alphadeg);		CYdR    =   interp1(AlphaTable,CYdRTable,alphadeg);		CYdAS   =   interp1(AlphaTable,CYdASTable,alphadeg);	CY      =   CYbeta*betar + CYp*x(7) + CYr*x(9) ...                + CYdA*u(2) + CYdR*u(3) + CYdAS*u(5);%	Rolling Moment Coefficient	Clbeta	=	interp1(AlphaTable,ClBetaTable,alphadeg);	Clp	    =	interp1(AlphaTable,ClpHatTable,alphadeg)*b/(2*V);					Clr	    =	interp1(AlphaTable,ClrHatTable,alphadeg)*b/(2*V);					CldA    =	interp1(AlphaTable,CldATable,alphadeg);	CldR	=	interp1(AlphaTable,CldRTable,alphadeg);	CldAS   =   interp1(AlphaTable,CYdASTable,alphadeg);    	Cl      =	Clbeta*betar + Clr*x(9) + Clp*x(7) ...                + (CldA*u(2) + CldR*u(3) + CldAS*u(5));%	Yawing Moment Coefficient	Cnbeta	=	interp1(AlphaTable,CnBetaTable,alphadeg);	Cnp	    =	interp1(AlphaTable,CnpHatTable,alphadeg)*b/(2*V);					Cnr	    =	interp1(AlphaTable,CnrHatTable,alphadeg)*b/(2*V);					CndA    =	interp1(AlphaTable,CndATable,alphadeg);	CndR	=	interp1(AlphaTable,CndRTable,alphadeg);	CndAS   =   interp1(AlphaTable,CndASTable,alphadeg);	Cn      =	Cnbeta*betar + Cnp*x(7) + Cnr*x(9) ...                + (CndA*u(2) + CndR*u(3) + CndAS*u(5));                                    